const About = (props) => {
  return (
    <section id="about" className="d-flex align-items-center">
      <div className="container-fluid">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row">
              <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                <h1>About Me</h1>
                <h1>this is about me page</h1>

                <div className="mt-3">
                  <NavLink smooth to="/#contact" className="btn-get-started">
                    Contact Me
                  </NavLink>

                  <NavLink smooth to="#resume" className="btn-get-started">
                    View Resume
                  </NavLink>
                </div>
              </div>

              {/* <div className="col-lg-6 order-1 order-lg-2 header-img ">
                <img
                  src={props.imgsrc}
                  className="image-fluid animated responsive picture"
                  alt="CommonParent img"
                />
              </div> */}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
